import React from 'react'

const Pay = () => {
  return (
      <div
          style={{
              height: "100vh",
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
          }}
      >
          <button
              style={{
                  border: "none",
                  width: 120,
                  borderRadius: 5,
                  padding: "20px",
                  backgroundColor: "black",
                  color: "white",
                  fontWeight: "600",
                  cursor: "pointer",
              }}
          >
              Pay Now
          </button>
    </div>
  )
}

export default Pay
